  Sandstone Unit of Rice Lake NWR summarizes background information on the location,
  history, environment, resources, administration, current management direction, and
  agreements/permits on the refuge. management strategies for meeting refuge objectives-
  including wildlife maintenance (endangered/threatened species), wildlife maintenance
  (waterfowl), wildlife maintenance-other migratory birds, environmental preservation,
  wildlife/wildlands diversity, and wildlife observation/appreciation- are described
  in part ii of the plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
